pred_query:
SELECT 100 * ( (SUM(CASE WHEN jobs.job_desc = 'publisher' THEN 1 ELSE 0 END) - SUM(CASE WHEN jobs.job_desc = 'designer' THEN 1 ELSE 0 END)) / SUM(CASE WHEN jobs.job_desc = 'designer' THEN 1 ELSE 0 END) ) AS percentage_more
FROM employee
JOIN jobs ON employee.job_id = jobs.job_id;

SELECT 
    (SELECT L FROM Teams WHERE year = 2010 AND tmID = 'BOS') AS loses,
    (SELECT SUM(A) FROM Scoring WHERE year = 2010 AND tmID = 'BOS') AS assists;

SELECT TOP 1 PurchaseOrderID, TaxAmt
FROM PurchaseOrderHeader
ORDER BY TaxAmt DESC;
